import React, {
    createContext,
    useState
} from 'react';

export const UserContext = createContext();

export const UserProvider = (props) => {
    const [users, setUsers] = useState(null);

    return (
        <>
            <UserContext.Provider value={[users, setUsers]}>
                {props.children}
            </UserContext.Provider>
        </>
    )
}
